INSERT INTO `board_comment` VALUES ('49', 'koweb', 'board_lectures', '4', '49', '1', '49', '', '', 'web,ko', '1dc934414c7b2806e73fc5b62bd79a03125470c002aab6ecee585a6dc861cd77', '', '', '', '', '', ' ', '<h2 data-v-3dc7a90c=\"\" data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7#toc\" id=\"s-1\">1.</a>&nbsp;개요<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/edit/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7?section=1\" rel=\"nofollow\">[편집]</a></h2>\r\n\r\n<blockquote data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%A0%95%EB%B3%B4%ED%86%B5%EC%8B%A0%EA%B8%B0%EC%88%A0\" title=\"정보통신기술\">정보통신기술</a>&nbsp;기반으로 모든&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC\" title=\"사물\">사물</a>을 연결해 사람과 사물, 사물과 사물간에 정보를 교류하고 상호 소통하는 지능형 인프라 및 서비스 기술 (<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EA%B3%BC%ED%95%99%EA%B8%B0%EC%88%A0%EC%A0%95%EB%B3%B4%ED%86%B5%EC%8B%A0%EB%B6%80\" title=\"과학기술정보통신부\">과학기술정보통신부</a>)</blockquote>\r\n\r\n<blockquote data-v-4ad90e21=\"\">IoT는 감지 가능하고 프로그래밍 가능한, 지능적이며 보이지 않는 네트워크망을 구성한다. IoT제품들은 서로간에, 혹은 인터넷과 직접적, 혹은 간접적으로 통신할 수 있는&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%9E%84%EB%B2%A0%EB%94%94%EB%93%9C\" title=\"임베디드\">임베디드</a>기술을 사용한다.<br data-v-4ad90e21=\"\" />\r\nThe IoT creates an intelligent, invisible network fabric that can be sensed, controlled and programmed. IoT-enabled products employ embedded technology that allows them to communicate, directly or indirectly, with each other or the Internet.<br data-v-4ad90e21=\"\" />\r\n(&nbsp;<a data-v-4ad90e21=\"\" href=\"http://www.ti.com/lit/ml/swrb028/swrb028.pdf\" rel=\"nofollow noopener\" target=\"_blank\" title=\"http://www.ti.com/lit/ml/swrb028/swrb028.pdf\">The Evolution of the Internet of Things</a>&nbsp;-&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%ED%85%8D%EC%82%AC%EC%8A%A4%20%EC%9D%B8%EC%8A%A4%ED%8A%B8%EB%A3%A8%EB%A8%BC%ED%8A%B8\" title=\"텍사스 인스트루먼트\">텍사스 인스트루먼트</a>)</blockquote>\r\n<br data-v-4ad90e21=\"\" />\r\n<strong data-v-4ad90e21=\"\">IoT; I</strong>nternet&nbsp;<strong data-v-4ad90e21=\"\">o</strong>f&nbsp;<strong data-v-4ad90e21=\"\">T</strong>hings<br data-v-4ad90e21=\"\" />\r\n<br data-v-4ad90e21=\"\" />\r\n<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%A0%95%EB%B3%B4%ED%86%B5%EC%8B%A0%EA%B8%B0%EC%88%A0\" title=\"정보통신기술\">정보통신기술</a>(ICT)의 발달에 따라 나타난 개념이다. 말 그대로 여러 사물에 컴퓨터 통신기능을 달아서&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%8A%A4%EB%A7%88%ED%8A%B8%ED%8F%B0\" title=\"스마트폰\">스마트폰</a>과 연동시키는 것이다.<br data-v-4ad90e21=\"\" />\r\n<br data-v-4ad90e21=\"\" />\r\n이 용어는&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/1999%EB%85%84\" title=\"1999년\">1999년</a>에&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/MIT\" title=\"MIT\">MIT</a>의 오토아이디센터(Auto ID Center)의 케빈 애시턴이&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/RFID\" title=\"RFID\">RFID</a>와 센서 등을 활용하여 사물에 탑재된 인터넷이 발달할 것이라 예측한 데서 비롯되었다. 이름에서 알 수 있듯이, 사물인터넷은 사람과 사람간의 통신을 넘어 사물에 IP 주소를 부여하고 사람과 사물, 혹은 사물과 사물간의 통신을 이끌어내는 기술을 일컫는다. 흔히 원격에서 조작을 하는 기기를 사물인터넷으로 생각하곤 하는데, 사물인터넷은 그 기기에 설정된 인터넷시스템까지 포함한다.\r\n\r\n<h2 data-v-3dc7a90c=\"\" data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7#toc\" id=\"s-2\">2.</a>&nbsp;유의어<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/edit/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7?section=2\" rel=\"nofollow\">[편집]</a></h2>\r\n\r\n<h3 data-v-3dc7a90c=\"\" data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7#toc\" id=\"s-2.1\">2.1.</a>&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%9C%A0%EB%B9%84%EC%BF%BC%ED%84%B0%EC%8A%A4\" title=\"유비쿼터스\">유비쿼터스</a><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/edit/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7?section=3\" rel=\"nofollow\">[편집]</a></h3>\r\n<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%9C%A0%EB%B9%84%EC%BF%BC%ED%84%B0%EC%8A%A4\" title=\"유비쿼터스\">유비쿼터스</a>와 비슷하지만 기존의 자체적인 통신시스템을 인터넷이란 체제에 흡수함으로 더 확장된 개념이 되었다.\r\n\r\n<h3 data-v-3dc7a90c=\"\" data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7#toc\" id=\"s-2.2\">2.2.</a>&nbsp;Machine to Machine<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/edit/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7?section=4\" rel=\"nofollow\">[편집]</a></h3>\r\n사물인터넷 개념은 흔히&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/M2M\" title=\"M2M\">M2M</a>. Machine to Machine으로 불리기도 하지만 M2M과 IoT 개념은 살짝 다르다. 거칠게 말하면 M2M은 단말기와 단말기 사이의 정보교환을 일컫는 다소 기술적이고 좁은 용어로, 이 M2M을 가능한 모든 전자기기로 확장해 에코시스템화한 것이 IoT라고 할 수 있다. 사물인터넷은 보다 본격적으로 사물간 네트워크 활성화에 &#39;인터넷&#39;을 도입하는 경향이 강하며 능동적인 면이 부각된다. 한편 M2M은 리모콘이나 바코드 리더기처럼 &#39;통신&#39;에만 국한된 측면이 강하며, 전부는 아니지만 대체로 덜 능동적이다.\r\n\r\n<h3 data-v-3dc7a90c=\"\" data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7#toc\" id=\"s-2.3\">2.3.</a>&nbsp;스마트 디바이스<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/edit/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7?section=5\" rel=\"nofollow\">[편집]</a></h3>\r\n스마트폰, 태블릿, 스마트워치, 스마트 타투 등 사물인터넷 관련 기기들을 통칭하는 개념이다.\r\n\r\n<h2 data-v-3dc7a90c=\"\" data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7#toc\" id=\"s-3\">3.</a>&nbsp;양상<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/edit/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7?section=6\" rel=\"nofollow\">[편집]</a></h2>\r\n2017년 7월 현재 한국의 사물인터넷의 회선수는 약 611만 회선이며 대충 아래의 5가지 응용으로 나누어진다. (괄호 안은 현재 서비스 회선수, 월요금단가, 월간시장규모) 시장규모는 월 552억원, 연간 약6000억 정도이다.\r\n\r\n<ul data-v-4ad90e21=\"\">\r\n	<li data-v-4ad90e21=\"\">차량관제 (126만, 1만6500원, 207억원) - 화물차, 컨테이너의 위치추적 등 이동체의 위치나 상태 감시 또는 제어</li>\r\n	<li data-v-4ad90e21=\"\">원격관제 (219만, 385원~2200원, 20억원 이상) - 원격검침, 교통, 수도, 전력, 도로 시설 감시 등 고정기기의 상태감시 또는 제어</li>\r\n	<li data-v-4ad90e21=\"\">무선결제 (71만, 1만 1천원, 78억원) - 음식배달원의 휴대용 신용카드 결제단말기 같은 VAN 업무.</li>\r\n	<li data-v-4ad90e21=\"\">태블릿PC (65만, 요금 2만원, 130억원) - 보험 외판사원이나 물류관리, 현장관리 등 휴대형 태블릿같은 휴대단말 통신,</li>\r\n	<li data-v-4ad90e21=\"\">웨어러블 (107만, 1만 1천원, 117억원) - 아동이나 치매노인들의 위치추적장치 등 개인대상 서비스</li>\r\n</ul>\r\n<br data-v-4ad90e21=\"\" />\r\n1시간에 1번꼴로 가스나 수도, 맨홀 상태를 원격 검침하는 정도면 월 100KB(킬로바이트)를 제공하는 월 350원(부가세 포함 385원) 요금제로 충분하다. 가로등 관제처럼 송수신 간격이 10분에 1번꼴이면 월 500원, 1분에 1번이면 월 700원 수준으로 요금이 늘어난다. 움직이는 사람이나 차량 관제는 월 데이터가 10~100MB 정도인 월 1000~2000원 요금제를 써야 한다.\r\n<h3 data-v-3dc7a90c=\"\" data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7#toc\" id=\"s-3.1\">3.1.</a>&nbsp;B2B, B2G<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/edit/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7?section=7\" rel=\"nofollow\">[편집]</a></h3>\r\nB2G(Business to Government), B2B(Business to Business)<br data-v-4ad90e21=\"\" />\r\n<br data-v-4ad90e21=\"\" />\r\n현재 IoT 시장 전체 매출의 90% 이상은 이 쪽에서 난다고 봐도 무방하다고 볼 수 있다. 주로&nbsp;<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EB%B9%85%20%EB%8D%B0%EC%9D%B4%ED%84%B0%20%ED%94%84%EB%A1%9C%EC%84%B8%EC%8B%B1\" title=\"빅 데이터 프로세싱\">빅 데이터 프로세싱</a>과 결합되어 대기업의 생산공정개선 또는 업무효율화 솔루션, 마케팅회사의 데이터 수집, 정부기관의 위치추적 솔루션 등 대규모 자본이 책정되는 사업을 쓸어담고 있다. 비콘, 센서 등에 LTE와 같은 광역 무선 통신을 결합해 막대한 양의 데이터를 수집하고 정리하여 생산시설의 프로세스 개선, 정부기관의 용역, 보험요율의 정밀한 산정, 오프라인 매장을 가진 기업들의 마케팅 솔루션 개발 등을 한다. 2015년 대한민국 정부예산 중 2~3조 가량이 IoT 관련 기업에게 낙찰되었는데, 대개 사회안정기반사업(전자발찌(!)), 대국민 서비스(독거노인 추적관리) 등에 들어갔다.\r\n\r\n<h4 data-v-3dc7a90c=\"\" data-v-4ad90e21=\"\"><a data-v-4ad90e21=\"\" href=\"https://namu.wiki/w/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7#toc\" id=\"s-3.1.1\">3.1.1.</a>&nbsp;스마트 팩토리<a data-v-4ad90e21=\"\" href=\"https://namu.wiki/edit/%EC%82%AC%EB%AC%BC%EC%9D%B8%ED%84%B0%EB%84%B7?section=8\" rel=\"nofollow\">[편집]</a></h4>\r\n생산 공정에서 사용하는 각종 장치 및 설비들에 이를 관리하기 위한 다양한 센서를 부착하고, 이를 클라우드와 연동하여 데이터 수집, 모니터링, 제어 및 관련 정책의 수립 등을 수행하는 분야다.<br data-v-4ad90e21=\"\" />\r\n나날이 환경에 대한 규제와 관리 감독이 강화되면서, 탄소 배출량의 계측 및 조절 등과 맞물려서 활성화되고 있다. 한국에서는 산업통상자원부 지원 정책이 시행 중이며 자세한 것은 아래 사이트에서 참고할 것.<a data-v-4ad90e21=\"\" href=\"http://www.smart-factory.kr/\" rel=\"nofollow noopener\" target=\"_blank\" title=\"http://www.smart-factory.kr/\">http://www.smart-factory.kr/</a>', '', '', '', '2022-08-24 21:09:44', '106.242.31.74', 'Chapter.1 사물인터넷', '70658_sample_images_01.png', 'sample_images_02.png', '20773_sample_images_03.png', 'sample_images_04.png', 'sample_images_05.png', '', '', '', '', '');
INSERT INTO `board_comment` VALUES ('50', 'koweb', 'board_lectures', '6', '50', '1', '50', '', '', 'web,ko', '1dc934414c7b2806e73fc5b62bd79a03125470c002aab6ecee585a6dc861cd77', '', '', '', '', '', ' ', '<h2>What is Lorem Ipsum?</h2>\r\n\r\n<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<h2>Why do we use it?</h2>\r\n\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n&nbsp;\r\n\r\n<h2>Where does it come from?</h2>\r\n\r\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of &quot;de Finibus Bonorum et Malorum&quot; (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, ver</p>\r\n', '', '', '', '2022-08-24 21:12:45', '106.242.31.74', 'CH.1 IoT_modify', '30790_sample_images_01.png', 'sample_images_01.png', '', '', '', '', '', '', '', '');
INSERT INTO `board_comment` VALUES ('53', 'koweb', 'board_lectures', '7', '53', '1', '53', '', '', 'web,ko', '1dc934414c7b2806e73fc5b62bd79a03125470c002aab6ecee585a6dc861cd77', '', '', '', '', '', ' ', '<h3>가장 이해하기 쉽게 설명하면, 사물인터넷(IoT)에는 인터넷 네트워크에 무선으로 연결될 수 있는 모든 물체(&#39;사물&#39;)가 포함됩니다. 그러나 오늘날 IoT라는 용어는 사용자에게 정보를 제공하거나 운영을 자동화하기 위해 데이터 송수신을 지원하는 센서, 소프트웨어 및 기타 기술을 탑재하고 있으며 서로 연결된 사물을 의미하는 것으로 더 구체화되었습니다. 이전에는 연결에 Wi-Fi가 주로 사용되었지만 오늘날에는 5G 및 기타 유형의 네트워크 플랫폼이 거의 모든 곳에서 빠르고 안정적으로 대량의 데이터 세트를 처리합니다.</h3>\r\n', '', '', '', '2022-08-25 09:41:18', '106.242.31.74', 'Chapter.1 IoT intro', '12710_sample_images_01.png', '', '', '', '', '', '', '', '', '');
INSERT INTO `board_gallery2` VALUES ('1', '0', '1', '1', 'koweb', '', '', 'koweb', '0ffe1abd1a08215353c233d6e009613e95eec4253832a761af28ff37ac5a150c', '', '', '', '', '', '1', '안녕하세요', '', 'TAG', '스테인리스(Stainless) 스틸은 영문명 그대로 녹이 잘 슬기 어려운 합금강이다. 일반 탄소강이 철(Fe)과 탄소(C)의 이원계 원소로 만든 제품이라면 스테인리스 스틸은 크롬, 니켈, 망간 등 합금원소를 첨가하여 제조한다.<br />\r\n스테인리스 스틸은 탄소강 대비 상대적으로 표면이 미려하고 내식성이 월등히 우수하기 때문에 사용 환경의 제약이 적고', '', '', '', '', '1111.jpg', '', '', '', '', '', '', '', '', '', '2020-04-09 11:36:14', '106.242.31.74', '', '', '', '', '', '', '', '', '', '', '', '', '', '23', '', '', null, null, null, null, null, null);
