INSERT INTO `board_simulator` VALUES ('1', '0', '1', '1', 'admin', '', '', 'tester', '8c5828b21a3637fcebb1fc3f2646f4a0ee715e317f38f28270532b5e3e7c7953', '', '', '', '', '', 'Noma Simulator', 'Massive Mimo-Noma Simulator', '', 'TAG', '<h1>Massive Multiple-Input-Multiple-Output (mMIMO) NOMA Simulator&nbsp;</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Download the mMIMO-NOMA Simulator Application&nbsp;<a href=\"https://www.dropbox.com/s/48fbg7towwnayqr/Massive_MIMO_NOMA_Simulator_v1.zip?dl=0\" rel=\"noopener noreferrer\" target=\"_blank\">here</a>.</p>\r\n\r\n<p>Download the Matlab Runtime Installer&nbsp;<a href=\"https://kr.mathworks.com/products/compiler/matlab-runtime.html\">here</a>.</p>\r\n\r\n<p>Download the User Manual and License Agreement&nbsp;<a href=\"https://www.dropbox.com/s/4ng30hc9hccpa92/Manual_Massive%20MIMO_NOMA_Simulator_v1.rar?dl=0\">here</a>.</p>\r\n\r\n<p>Download the tutorial&nbsp;<a href=\"https://www.dropbox.com/s/acyxvnh9yif9yhr/Demo_Video.mp4?dl=0\" rel=\"noopener noreferrer\" target=\"_blank\">here</a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We are happy to announce the release of the</p>\r\n\r\n<p><strong>mMIMO-NOMA</strong><strong>&nbsp;5G-Downlink Link Level Simulator&nbsp;</strong></p>\r\n\r\n<p>To get access to the download link, please send an e-mail to WENS Laboratory (labwens@gmail.com) that contains&nbsp;:</p>\r\n\r\n<p>1) Identity (name, date of birth, e-mail, phone number, address, and institution)</p>\r\n\r\n<p>2) The reason/purpose for using the mMIMO-NOMA Simulator.</p>\r\n\r\n<p>The features are listed below. You can also check the list of features and the documentation of the new version on the webpage of the corresponding simulator.</p>\r\n\r\n<p>You are welcome to post your questions/comments/feedback to the WENS Laboratory (labwens@gmail.com). Our team will try to support you as soon as possible. Please also read the license agreement carefully to check whether you would need our permission to use the simulator.</p>\r\n\r\n<p>Best regards,<br />\r\nThe mMIMO-NOMA Simulator Team.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Features of Massive MIMO NOMA Simulator:</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Parameters</strong></td>\r\n			<td><strong>mMIMO-OMA &amp; mMIMO-NOMA</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>No. of Cells</strong></td>\r\n			<td>Single Cell</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>No. of Users (K)</strong></td>\r\n			<td>2<sup>k</sup>&nbsp;users (k=2,3,4,&hellip;,10)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>No. of T/x Antennas (M)</strong></td>\r\n			<td>2<sup>m</sup>&nbsp;Antennas (m=2,3,4,&hellip;,10)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>No. of R/x Antennas</strong></td>\r\n			<td>Single Antenna</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>User Deployment</strong></td>\r\n			<td>Random User</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Network Setup</strong></td>\r\n			<td>Downlink with Perfect CSI</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Beamforming Technique</strong></td>\r\n			<td>Zero Forcing (ZF)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Bandwidth (B)</strong></td>\r\n			<td>20 MHz-100 MHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Power Allocation</strong></td>\r\n			<td>Fixed Power</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Channel Model</strong></td>\r\n			<td>NLOS</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interference Cancellation</strong></td>\r\n			<td>Perfect SIC</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Performance Parameter</strong></td>\r\n			<td>Bandwidth &amp; Spectral Efficiency</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Performance Comparison</strong></td>\r\n			<td>mMIMO-OMA vs mMIMO-NOMA</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Massive MIMO NOMA Simulator Team:</p>\r\n\r\n<p>1. Prof. Soo Young Shin</p>\r\n\r\n<p>2. Irfan Azam</p>\r\n\r\n<p>3. Muneeb Ahmad</p>\r\n\r\n<p>4. I Nyoman Apraz Ramatryana</p>\r\n\r\n<p>5. Bhaskara Narottama</p>\r\n', '', '', '', '', 'sample_images_01.png', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2022-08-10 09:48:16', '106.242.31.74', '', '', '', '', '', '', '', '', '', '', '', '', '', '4', '', '', null, null, null, null, null, null);
INSERT INTO `board_simulator` VALUES ('2', '0', '2', '2', 'admin', '', '', 'tester2', '8c5828b21a3637fcebb1fc3f2646f4a0ee715e317f38f28270532b5e3e7c7953', '', '', '', '', '', 'Noma Simulator', 'Noma Simulator', '', 'TAG', '<h1>NOMA (Non-Orthogonal Multiple Access) Simulator</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Download the NOMA Simulator application&nbsp;<a href=\"https://www.dropbox.com/s/hswba73jtz41iv5/NOMA_Simulator_v1.zip?dl=0\" rel=\"noopener noreferrer\" target=\"_blank\">here</a>.</h3>\r\n\r\n<h3>Download the NOMA Simulator paper&nbsp;<a href=\"https://doi.org/10.3390/electronics10192388\" rel=\"noopener noreferrer\" target=\"_blank\">here</a>.</h3>\r\n\r\n<h3>Download the tutorial&nbsp;<a href=\"https://youtu.be/C49QDUfxHYA\" rel=\"noopener noreferrer\" target=\"_blank\">here</a>.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We are happy to announce the release of the</p>\r\n\r\n<p><strong>NOMA Downlink System Level Simulator&nbsp;</strong></p>\r\n\r\n<p>To get access to the download link, please send an e-mail to WENS Laboratory (labwens@gmail.com) that contains&nbsp;:</p>\r\n\r\n<p>1) Identity (name, date of birth, e-mail, phone number, address, and institution)</p>\r\n\r\n<p>2) The reason/purpose for using the NOMA Simulator.</p>\r\n\r\n<p>The features are listed below. You can also check the list of features and the documentation of the new version on the webpage of the corresponding simulator. You can download our paper regarding NOMA simulator from the link given above. Please don&#39;t forget to cite our paper as:&nbsp;</p>\r\n\r\n<p><strong>A. Khan, M. A. Usman, M. R. Usman, M. Ahmad, and S.-Y. Shin, &ldquo;Link and System-Level NOMA Simulator: The Reproducibility of Research,&rdquo; Electronics, vol. 10, no. 19, p. 2388, Sep. 2021.</strong></p>\r\n\r\n<p>You are welcome to post your questions/comments/feedback to the WENS Laboratory (labwens@gmail.com). Our team will try to support you as soon as possible. Please also read the license agreement carefully to check whether you would need our permission to use the simulator.</p>\r\n\r\n<p>Best regards,<br />\r\nThe NOMA Simulator Team.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Features of NOMA Downlink System Level Simulator, (<em>2019-02-13</em>):</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Parameters</strong></td>\r\n			<td><strong>OMA</strong></td>\r\n			<td><strong>NOMA</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>- &nbsp; System Level</td>\r\n			<td>Downlink</td>\r\n			<td>Downlink</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- &nbsp; Random User</td>\r\n			<td>2 users</td>\r\n			<td>2 users</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- &nbsp; Multi-cell</td>\r\n			<td>3;7;19 cells</td>\r\n			<td>3;7;19 cells</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- &nbsp; Frequency</td>\r\n			<td>900;1800;2100;2600 MHz</td>\r\n			<td>900;1800;2100;2600 MHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- &nbsp; Propagation Model</td>\r\n			<td>Okumura-Hata;Cost-231</td>\r\n			<td>Okumura-Hata;Cost-231</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- &nbsp; Imperfect SIC</td>\r\n			<td>N/A</td>\r\n			<td>&nbsp;✔</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- &nbsp; Interference</td>\r\n			<td>Intercell interference;SINR</td>\r\n			<td>Intercell Interference;SINR</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- &nbsp; Cell Capacity</td>\r\n			<td>User capacity;Ergodic sum capacity</td>\r\n			<td>User capacity;Ergodic sum capacity</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NOMA Simulator Team :</p>\r\n\r\n<p>1. Prof. Soo Young Shin</p>\r\n\r\n<p>2. Dr. Arsla Khan</p>\r\n\r\n<p>3. Dr. Arslan Usman</p>\r\n\r\n<p>4. Dr. Rehan Usman</p>\r\n\r\n<p>5. Mohammed&nbsp;Belal Uddin</p>\r\n\r\n<p>6. Denny Kusuma Hendraningrat</p>\r\n\r\n<p>7. Irfan Azam</p>\r\n\r\n<p>8. Muneeb Ahmad</p>\r\n\r\n<p>9. Yong Bi Kwon</p>\r\n\r\n<p>10. Bhaskara Narottama</p>\r\n\r\n<p>11. I Nyoman Apraz Ramatryana</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>References:</p>\r\n\r\n<p>[1] &nbsp;Muhammad Basit Shahab, Mohammad Irfan, Md. Fazlul Kader, Soo Young Shin. &quot;<strong>User pairing schemes for capacity maximization in non-orthogonal multiple access systems</strong>&quot;, Wireless Communications and Mobile Computing, Volume 16, No. 17, pp 2884-2894 September 2016. (IF: 0.922). 5G.</p>\r\n\r\n<p>[2] &nbsp;Muhammad Basit Shahab, Md. Fazlul Kader, Soo Young Shin. &quot;<strong>A Virtual User Pairing Scheme to Optimally Utilize the Spectrum of Unpaired Users in Non-orthogonal Multiple Access</strong>&quot;, IEEE Signal Processing Letters, Volume 23, No. 12, pp 1766-1770 October 2016. (IF: 1.661). 5G.</p>\r\n\r\n<p>[3] &nbsp;Md. Fazlul Kader, Soo Young Shin. &quot;<strong>Exploiting cooperative diversity with nonorthogonal multiple access over slow fading channel</strong>&quot;, International Journal of Electronics, Volume 104, No. 6, pp 1050-1062 February 2017. (IF: 0.729). 5G.</p>\r\n\r\n<p>[4] &nbsp;Muhammad Basit Shahab, Soo Young Shin. &quot;<strong>On the performance of a virtual user pairing scheme to efficiently utilize the spectrum of unpaired users in NOMA</strong>&quot;, Physical Communication, Volume 25, pp 492-501 October 2017. (IF: 1.522). 5G.&nbsp;</p>\r\n\r\n<p>[5] &nbsp;Muhammad Basit Shahab, Soo Young Shin. &quot;<strong>On the performance of a virtual user pairing scheme to efficiently utilize the spectrum of unpaired users in NOMA</strong>&quot;, Physical Communication, Volume 25, No. 2, pp 492-501 December 2017. (IF: 1.522). 5G.&nbsp;&nbsp;</p>\r\n\r\n<p>[6] &nbsp;Muhammad Basit Shahab, Soo Young Shin. &quot;<strong>User pairing and power allocation for non-orthogonal multiple access: Capacity maximization under data reliability constraints</strong>&quot;, Physical Communication, Volume 30, No. 1, pp 132-144 October 2018. (IF: 1.522). ITRC-2017.&nbsp;&nbsp;</p>\r\n\r\n<p>[7] &nbsp;Mohammed Belal Uddin, Md. Fazlul Kader, Anik Islam, Soo Young Shin. &quot;<strong>Power Optimization of NOMA for Multi-Cell Networks</strong>&quot;, THE JOURNAL OF KOREA INFORMATION AND COMMUNICATIONS SOCIETY, Volume 43, No. 7, pp 1182-1190 July 2018. ITRC-2018.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>[8]&nbsp;Fahri Wisnu Murti, Rahmat Faddli Siregar, Soo Young Shin. &quot;<strong>Exploiting non-orthogonal multiple access in downlink coordinated multipoint transmission with the presence of channel estimation error</strong>&quot;, Physical Communication, May 2018. (IF: 1.583). 5G. (<em>Under Review</em>)&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>[9]&nbsp;Denny Kusuma Hendraningrat, Muhammad Basit Shahab, Soo Young Shin. &quot;<strong>Virtual User Pairing Based Non-Orthogonal Multiple Access in Downlink Coordinated Multipoint Transmission</strong>&quot;, IEEE Communication Letter, April 2019. (<em>Under Review</em>)&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>[10] Man Hee Lee, Shahab Muhammad Basit, Soo Young Shin. &quot;<strong>On the Performance of Non-orthogonal Multiple Access considering Backward Compatibility</strong>&quot;, Physical Communication, Priority Center-2019.</p>\r\n\r\n<p>[11] Mohammed Belal Uddin, Md. Fazlul Kader, Soo Young Shin. &quot;<strong>Exploiting NOMA in D2D Assisted Full-Duplex Cooperative Relaying</strong>&quot;, Physical Communication, Priority Center-2018.</p>\r\n\r\n<p>[12] Denny Kusuma Hendraningrat, Bhaskara Narottama, Soo Young Shin. &quot;<strong>Non-Orthogonal Multiple Access in Downlink Coordinated Multipoint Transmissions</strong>&quot;, Physical Communication, pp 1-26.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 'sample_images_02.png', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2022-08-10 09:48:38', '106.242.31.74', '', '', '', '', '', '', '', '', '', '', '', '', '', '5', '', '', null, null, null, null, null, null);
