INSERT INTO `koweb_site_config` VALUES ('40', 'kr', 'http://combine.daeguweb.gethompy.com/', '홈페이지통합관리자', 'http://combine.daeguweb.gethompy.com/', 'http://combine.daeguweb.gethompy.com/', 'http://combine.daeguweb.gethompy.com/', '홈페이지통합관리자', 'Y', '', '5', 'N', 'N', '', 'Y', 'MaotQsM0gYCXI1ZgQU69', 'TkGwr3rXw2', '', 'Y', 'bafb7f8a53e859e2d4d4448fd0f4818d', 'Y', '', '', '2021-08-04 15:4', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
INSERT INTO `koweb_site_config` VALUES ('41', 'kr', 'http://combine.daeguweb.gethompy.com/', '홈페이지통합관리자', 'http://combine.daeguweb.gethompy.com/', 'http://combine.daeguweb.gethompy.com/', 'http://combine.daeguweb.gethompy.com/', '홈페이지통합관리자', 'Y', '', '5', 'N', 'N', '', 'Y', 'MaotQsM0gYCXI1ZgQU69', 'TkGwr3rXw2', '', 'Y', 'bafb7f8a53e859e2d4d4448fd0f4818d', 'Y', '', '', '2021-08-04 15:4', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
INSERT INTO `koweb_site_config` VALUES ('42', 'kr', 'http://combine.daeguweb.gethompy.com/', '홈페이지통합관리자', 'http://combine.daeguweb.gethompy.com/', 'http://combine.daeguweb.gethompy.com/', 'http://combine.daeguweb.gethompy.com/', '홈페이지통합관리자', 'Y', '', '5', 'N', 'N', '', 'Y', 'MaotQsM0gYCXI1ZgQU69', 'TkGwr3rXw2', '', 'Y', 'bafb7f8a53e859e2d4d4448fd0f4818d', 'Y', '', '', '2021-08-10 10:3', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
INSERT INTO `koweb_site_config` VALUES ('44', 'kr', 'http://combine.daeguweb.gethompy.com/', '홈페이지통합관리자', 'http://combine.daeguweb.gethompy.com/', 'http://combine.daeguweb.gethompy.com/', 'http://combine.daeguweb.gethompy.com/', '홈페이지통합관리자', 'Y', '', '5', 'Y', 'N', '', 'Y', 'MaotQsM0gYCXI1ZgQU69', 'TkGwr3rXw2', '', 'Y', 'bafb7f8a53e859e2d4d4448fd0f4818d', 'Y', '', '', '2021-11-24 11:0', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
INSERT INTO `koweb_site_config` VALUES ('45', 'kr', 'http://goodbank.koweb.co.kr/', '굿뱅크', 'http://goodbank.koweb.co.kr/', 'http://goodbank.koweb.co.kr/', 'http://goodbank.koweb.co.kr/', '굿뱅크', 'Y', '', '5', 'Y', 'N', '', 'N', '', '', '', 'N', '', 'N', '', '', '2022-07-19 10:3', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
INSERT INTO `koweb_site_config` VALUES ('46', 'kr', 'http://combine.koweb.co.kr/', '통합관리자', 'http://combine.koweb.co.kr/', 'http://combine.koweb.co.kr/', 'http://combine.koweb.co.kr/', '통합관리자', 'Y', '', '5', 'Y', 'N', '', 'N', '', '', '', 'N', '', 'N', '', '', '2022-07-19 11:0', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
INSERT INTO `koweb_site_config` VALUES ('47', 'kr', 'http://wenslab.koweb.co.kr/', '웬즈렙', '웬즈렙', '웬즈렙', '웬즈렙', '웬즈렙', 'Y', '', '5', 'Y', 'N', '', 'N', '', '', '', 'N', '', 'N', '', '', '2022-08-23 15:4', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
INSERT INTO `koweb_site_config` VALUES ('48', 'kr', 'http://wenslab.koweb.co.kr/', 'WENS Lab', 'WENS Lab', 'WENS Lab', 'WENS Lab', 'WENS Lab', 'Y', '', '5', 'Y', 'N', '', 'N', '', '', '', 'N', '', 'N', '', '', '2022-08-23 15:4', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
INSERT INTO `koweb_site_config` VALUES ('49', 'kr', 'http://wenslab.koweb.co.kr/', 'WENS Lab', 'Welcome to Wireless & Emerging Network System Laboratory', 'Welcome to Wireless & Emerging Network System Laboratory', 'WENS Lab', 'WENS Lab', 'Y', '', '5', 'Y', 'N', '', 'N', '', '', '', 'N', '', 'N', '', '', '2022-08-24 21:2', '', '', '', '&#39;본 홈페이지&#39;는 회원님의 개인정보를 중요시하며, &quot;정보통신망 이용촉진 및 정보보호&quot;에 관한 법률을 준수하고 있습니다.&nbsp;<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 통하여 고객님께서 제공하시는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 개인정보보호를 위해 어떠한 조치가 취해지고 있는지 알려드립니다.<br />\r\n<br />\r\n본 홈페이지은 개인정보취급방침을 개정하는 경우 웹사이트 공지사항(또는 개별공지)을 통하여 공지할 것입니다.<br />\r\n<br />\r\n회사의 개인정보취급방침은 다음과 같은 내용을 담고 있습니다.<br />\r\n<br />\r\n1. 수집하는 개인정보의 항목<br />\r\n<br />\r\n본 홈페이지은 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n가. 수집항목<br />\r\n<br />\r\n수집항목 : 아이디, 비밀번호, 휴대전화번호, 지역, 회사주소, 상호명, 광고전화번호, 대부등록번호, 대부등록유효기간, 대표자이름, 대부업등록기관, 대부업등록기관전화번호, 접속 로그, 쿠키, 접속IP 정보<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n나. 개인정보 수집방법<br />\r\n<br />\r\n개인정보 수집방법 : 홈페이지(회원가입,게시판)<br />\r\n<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\n2. 개인정보의 수집 및 이용목적<br />\r\n<br />\r\n본 홈페이지은 수집한 개인정보를 다음의 목적을 위해 활용합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산<br />\r\n<br />\r\n: 콘텐츠 제공<br />\r\n<br />\r\n회원 관리<br />\r\n<br />\r\n: 회원제 서비스 이용에 따른 본인확인 , 개인 식별 , 불량회원의 부정 이용 방지와 비인가 사용 방지 , 가입 의사 확인 , 연령확인 , 만14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인<br />\r\n<br />\r\n&nbsp;마케팅 및 광고에 활용<br />\r\n<br />\r\n: 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n3. 개인정보의 보유 및 이용기간<br />\r\n<br />\r\n원칙적으로, 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다.&nbsp;<br />\r\n<br />\r\n단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 본 홈페이지은 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n보존 항목 : 로그인ID , 결제기록<br />\r\n<br />\r\n보존 근거 : 신용정보의 이용 및 보호에 관한 법률<br />\r\n<br />\r\n보존 기간 : 3년<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 표시/광고에 관한 기록 : 6개월 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 계약 또는 청약철회 등에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 대금결제 및 재화 등의 공급에 관한 기록 : 5년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 소비자의 불만 또는 분쟁처리에 관한 기록 : 3년 (전자상거래등에서의 소비자보호에 관한 법률)<br />\r\n<br />\r\n- 신용정보의 수집/처리 및 이용 등에 관한 기록 : 3년 (신용정보의 이용 및 보호에 관한 법률)', '본 홈페이지(이하 &ldquo;회사&rdquo;라고 합니다)가 제공하는 인터넷 관련 서비스(이하 &#39;서비스&#39;라고 합니다.)를 회사가 운영하는 웹사이트 (이하 &ldquo;본 홈페이지&rdquo;이라고 합니다.)를 통해 서비스 이용자(이하 &ldquo;이용자&rdquo;라고 합니다.)에게 제공할 때 다음과 같은 내용으로 그 법적인 책임의 한계를 고지합니다.<br />\r\n<br />\r\n2. 서비스 운영 책임<br />\r\n<br />\r\n회사는 웹사이트 서비스 이용약관 및 기타 관련 법령에 따라 타인의 권리를 존중하며 이에 위반되는 사항이 없도록 노력합니다. 또한, 이용자 중 이를 위반하는 경우 사전 통지 없이 서비스 이용에 제한 조치를 받을 수 있습니다.&nbsp;<br />\r\n<br />\r\n3. 서비스에 대한 책임<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n- 이용자는 자료에 대한 신뢰 여부가 전적으로 이용자의 책임임을 인정합니다.<br />\r\n<br />\r\n- 웹사이트는 자료 및 서비스의 내용을 수정할 의무를 지지 않으며, 필요에 따라 개선할 수는 있습니다.<br />\r\n<br />\r\n- 웹사이트를 통하여 인터넷을 접속함에 있어 이용자의 개인적인 판단에 따라 접속하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 지적재산권을 포함한 타인의 권리를 존중하며, 사용자들도 마찬가지로 행동해 주시길 기대합니다.<br />\r\n<br />\r\n- 어떠한 경우에도 웹사이트는 서비스 자료 및 관련하여 직접, 간접, 부수적, 징벌적, 파생적인 손해에 대해서 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트를 통해 일부 사람들이 불쾌하거나 부적절 하다고 여기는 정보가 포함되어 있는 사이트로 연결될 수 있습니다.<br />\r\n<br />\r\n- 웹사이트는 자료에 열거되어 있는 사이트의 내용을 검토하려는 노력과 관련하여 어떠한 보증도 하지 않습니다.<br />\r\n<br />\r\n- 또한 웹사이트는 자료에 열거되어 있는 사이트상의 자료의 정확성, 저작권 준수, 적법성 또는 도덕성에 대해 아무런 책임을 지지 않습니다.<br />\r\n<br />\r\n- 웹사이트는 필요한 경우 그 재량에 의해 타인의 권리를 침해하거나 위반하는 사용자에 대하여 사전 통지 없이 서비스 이용 제한 조치를 취할 수 있습니다.<br />\r\n<br />\r\n- 제휴업체 등이 제공하는 다양한 서비스에 대한 질문과 불만에 대하여는 해당 업체 등에 직접 연락을 취하시기 바랍니다.<br />\r\n<br />\r\n- 웹사이트는 업체의 활동, 상점에서 제공되는 상품이나 서비스, 또는 게재되는 내용, 개별 서비스 업체로의 접속 또는 접속 불능으로 인한 어떠한 손해, 손실, 상해 등 이용자와 입점 업체간에 행하여지는 거래에 대해서 명시적으로 어떠한 책임이나 의무도 부담하지 아니합니다.<br />\r\n<br />\r\n-본 홈페이지은 개인 고객들께 대출업체를 무료로 정보를제공하며 이용자업체들간 직접거래가 이루어지며 민.형사상책임은 이용자와 대출업체에 있으며 본 홈페이지에서는 법적 책임을 지지 않습니다.');
